oxy_webhelp_navlinks = {"desktop_private_client_workspace-d2170e224":{"topics":[{"title":"Desktop workspace UI page for Private Client","shortdesc":"<p class=\"shortdesc\">Desktop workspace for Private Client is a user interface starting page that is         designed for Private Client role and runs on  all desktop platforms. The workspace is opened         as Private Clients login to the internet banking application. Private Clients manage their         banking operations within workspace.<\/p>","href":"topics\/privat_clients_ui_workspace.html","attributes":{"data-id":"privat_clients_ui_workspace"},"menu":{"hasChildren":false},"tocID":"privat_clients_ui_workspace-d2170e232","next":"privat_clients_ui_workspace-d2170e232"},{"title":"Desktop tasks UI pages for Private Clients","shortdesc":"<p class=\"shortdesc\">Clients handle internet banking operations within specially designed UI pages. Those         banking operations we considered for Tasks. Changing card pin code, making new payment,         setting payment orders etc. are banking Tasks. Usually to gain a result you need to pass         some steps. To ease handling all task steps, special UI page is created.<\/p>","href":"topics\/privar_clients_tasks_ui_pages.html","attributes":{"data-id":"privar_clients_tasks_ui_pages"},"menu":{"hasChildren":false},"tocID":"privar_clients_tasks_ui_pages-d2170e295","next":"privar_clients_tasks_ui_pages-d2170e295"},{"title":"Desktop UI controls for Private Clients","shortdesc":"<p class=\"shortdesc\">UI control is a visual representative of  a task's step. Drop down menu, buttons,         fields etc. are UI controls. UI controls are usually connected to software application         source code steps (functions) and data.<\/p>","href":"topics\/privar_clients_steps_ui_controles.html","attributes":{"data-id":"privar_clients_steps_ui_controles"},"menu":{"hasChildren":false},"tocID":"privar_clients_steps_ui_controles-d2170e478","next":"privar_clients_steps_ui_controles-d2170e478"}]}};